import Countup from 'react-c'
import img from './components/carpage/teslaimg/pngegg.png'
const LoadingPage = () => {
    return (  
        <div class="loadinglogo">
        <img src={img} />
        <h1>Loading The site 🖤  </h1>
        <h3>© 2020 Copyright:  Naoufel Bahassoune 👨‍💻</h3>
        </div>
    );
}
 
export default LoadingPage;
